            mapDiv.style.pointerEvents = 'none'; document.getElementById('chart').style.pointerEvents = 'none';
        });
        document.addEventListener('mousemove', function(e) {
            if (!isDragging) return;
            handleDrag(e.clientY);
        });
        document.addEventListener('mouseup', function(e) {
            if (!isDragging) return;
            endDrag();
        });

        gutter.addEventListener('touchstart', function(e) {
            isDragging = true; 
            mapDiv.style.pointerEvents = 'none'; 
            document.getElementById('chart').style.pointerEvents = 'none';
        });
        document.addEventListener('touchmove', function(e) {
            if (!isDragging) return;
            e.preventDefault(); 
            handleDrag(e.touches[0].clientY);
        }, {passive: false});
        document.addEventListener('touchend', function(e) {
            if (!isDragging) return;
            endDrag();
        });

        function handleDrag(clientY) {
            const containerRect = container.getBoundingClientRect();
            let newHeight = clientY - containerRect.top;
            if (newHeight < 50) newHeight = 50;
            if (newHeight > containerRect.height - 50) newHeight = containerRect.height - 50;
            let percent = (newHeight / containerRect.height) * 100;
            mapDiv.style.height = percent + '%';
        }

        function endDrag() {
            isDragging = false; 
            document.body.style.cursor = 'default';
            mapDiv.style.pointerEvents = 'auto'; 
            document.getElementById('chart').style.pointerEvents = 'auto';
            Plotly.Plots.resize('map'); 
            Plotly.Plots.resize('chart');
        }

        function updateDashboard() {

            const mode = document.getElementById('sel_mode').value;
            updateMap(type);
            drawChart(curSid, type, mode);
        }

        function getRange(type) {
            if (manualMin !== null && manualMax !== null) return [manualMin, manualMax];
            return (type === 'TEMP') ? rangeTemp : rangeHumi;
        }

        function updateMap(type) {
            const vals = mIds.map(id => {
                let val = sData[id][type][0];
                return (val === null) ? null : val;
            });
            const label = (type === 'TEMP') ? 'Ê∫´Â∫¶' : 'ÊøïÂ∫¶';
            const unit = (type === 'TEMP') ? '¬∞C' : '%';
            
            const hov = mIds.map((id,i) => {

                let vStr = (v === null) ? 'No Data' : v.toFixed(1);

                xaxis:{range:[0,iW], showgrid:false, visible:false}, 
                yaxis:{range:[iH,0], showgrid:false, visible:false},

                margin:{l:20,r:20,t:50,b:20}, hovermode:'closest' 
            };

            for(let i=0;i<vals.length;i++){

            }

            const hlSym = (type === 'TEMP') ? 'square' : 'circle';
            
            const mData=[

                    }

        function throttle(func, limit) {
            let inThrottle;
            return function() {
                const args = arguments;
                const context = this;
                if (!inThrottle) {
                    func.apply(context, args);
                    inThrottle = true;
                    setTimeout(() => inThrottle = false, limit);
                }
            }
        }

            let fy={

            const updateMapState = function(d) {

                    return `${mNames[i]}<br>${label}: ${vStr}`;
                });
                
                let maxV=-Infinity, maxI=-1; 
                for(let i=0;i<nc.length;i++){
                    if(nc[i] !== null && nc[i]>maxV){maxV=nc[i];maxI=i;}
                }
                
                Plotly.restyle('map', {
                    'marker.color': [nc],

                const peakBtn = document.getElementById('cb_peak');
                if(peakBtn && peakBtn.checked && maxI >= 0){ 
                    Plotly.restyle('map', {'x': [[mX[maxI]]], 'y': [[mY[maxI]]]}, [1]); 
                }
            };

            const throttledUpdate = throttle(updateMapState, 150);
            document.getElementById('chart').on('plotly_hover', throttledUpdate);

            // [Á∂≠ÊåÅ v66] Á∂ÅÂÆöÈªûÊìä‰∫ã‰ª∂ÔºåËß£Ê±∫ÊâãÊ©üÁÑ°Ê≥ïÊá∏ÂÅúÁöÑÂïèÈ°å
            document.getElementById('chart').on('plotly_click', function(d) {
                updateMapState(d);
            });
        }

        function getCurrentShapes() {
            let shapes = [...gStaticShapes];
            if (document.getElementById('cb_work').checked) shapes = shapes.concat(gWorkShapes);
            if (document.getElementById('cb_sun').checked) shapes = shapes.concat(gSunShapes);
